import styled from "styled-components";

const FooterContainer = styled.div`
  height: 120px;
  background: #70cceb;
  box-shadow: -5px -5px #888888;
  width: 80%;
  text-align: center;
`;

export default function Footer() {
  return (
    <FooterContainer>
      <div>Copyright 2020, Example Corporation</div>
    </FooterContainer>
  );
}
